    /// The formula linearly interpolates between 100 km at zoom level 2 and 0 km at zoom level 22:
    ///     threshold = -99.999 / 20 * (zoomLevel - 2) + 100
    /// This is used to determine whether the user's location is "close" to the current camera position.
    /// Expected input: zoomLevel (typically between 2 and 22 for Google Maps).
    /// Output: distance threshold in kilometers (between 0 and 100).
    /// </summary>
